import { Component } from '@angular/core';
import {au}

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html'
})
export class LoginComponent {

  usuario: string;
  contraseña: string;

  constructor(private authService: AuthService) { }

  login() {
    this.authService.login(this.usuario, this.contraseña).subscribe(response => {
      console.log('Login exitoso', response);
      // Guardar el token en el local storage o manejar la autenticación
    }, error => {
      console.error('Error en el login', error);
    });
  }
}
